import React, { useState, useEffect, Component } from "react";
import MaterialTable from "material-table";

import { authAxios } from "../../utils";
import { orderListURL } from "../../constants";

function Test2() {
  const [orders, setOrders] = useState([]);
  const [loading, setLoading] = useState(false);

  useEffect(() => {
    const fetchOrders = async () => {
      setLoading(true);
      const res = await authAxios.get(orderListURL);
      setOrders(res.data);
      setLoading(false);
    };

    fetchOrders();
  }, []);

  const columns = [
    { label: "Shop Name", id: "shop_name" },
    { label: "Total Amount", id: "total" },
    { label: "Data", id: "start_date" },
    { label: "Status", id: "order_status" }
  ];

  return (
    <MaterialTable
      title="One Detail Panel Preview"
      columns={columns}
      data={orders}
      detailPanel={orders.map(order => {
        return (
          <MaterialTable
            title="One Detail Panel Preview"
            columns={columns}
            data={order}
          />
        );
      })}
    />
  );
}

export default Test2;
